(2, 'kk', '2022-06-09', 'Krishnakumar Kunnath, popularly known as KK, was an Indian playback singer. He recorded songs in several languages, including Hindi, Tamil, Telugu, Kannada, Malayalam, Marathi, Odia, Bengali, Assamese and Gujarati. '),
(3, 'Arijit Singh', '2022-06-10', 'Arijit Singh is an Indian singer and music composer. He sings predominantly in Hindi and Bengali, but has also performed in various other Indian languages'),
(4, 'Honey Singh', '2022-06-02', 'Hirdesh Singh, known professionally as Yo Yo Honey Singh or simply Honey Singh, is an Indian music producer, composer, rapper, pop singer, lyricist and a film actor. He started out in 2003 as a session and recording artist, and became a bhangra and hip ho'),
(7, 'Sonu Nigam', '1973-07-13', 'Sonu Nigam is an Indian singer, music director and actor. He has been described in the media as one of the most popular and successful playback singers of Hindi Cinema.'),
(8, 'Jubin Nautiyal', '1989-06-14', 'Jubin Nautiyal is an Indian playback singer and performer. He was awarded Upcoming Male Vocalist of the Year at 8th Mirchi Music Awards for his song \"Zindagi Kuch Toh Bata\" from Bajrangi Bhaijaan. He also won the Rising Musical Star Award at Zee Business '),
(9, 'Armaan Malik', '1995-08-12', 'Armaan Malik is an Indian singer, songwriter, record producer, voice-over, performer and actor. He is known for his singing in multiple languages, including Hindi, Telugu, English, Bengali, Kannada, Marathi, Tamil, Gujarati, Punjabi, Urdu, Malayalam'),
(10, 'Shaan', '1972-01-31', 'Shantanu Mukherjee, known as Shaan, is an Indian playback singer, actor and television presenter active in Hindi, Bengali, Marathi, Assamese, Kannada, Telugu, Tamil, Gujarati, Marathi, Malayalam and Urdu language films and a television host'),
(11, 'Himesh Reshammiya', '1984-04-13', 'Himesh Reshammiya is an Indian playback singer, music director, songwriter, film & music producer and actor in Bollywood.'),
(12, 'Kumar Sanu', '1957-10-20', 'Kedarnath Bhattacharaya, better known as Kumar Sanu, is an Indian playback singer. He is known as the King of Melody in Bollywood. His voice and singing style are heavily influenced by singer Kishore Kumar. '),
(13, 'Ankit Tiwari', '1983-03-06', 'Ankit Tiwari is an Indian playback singer, music director, composer. His career began upon meeting Pradeep Sarkar where he got a chance to work on jingles and started composing background music for television programmes. '),
(14, 'Shreya Ghoshal', '1989-05-13', 'Shreya Ghoshal is an Indian singer and television personality. '),
(15, 'Atif Aslam', '1983-02-13', 'Muhammad Atif Aslam is a Pakistani playback singer, songwriter, composer and actor who is best known for his songs in the Pakistani and Indian film industries. '),
(16, 'Neha kakkar', '1984-08-12', 'Neha Kakkar Singh, is an Indian playback singer. She is the younger sister of playback singer Sonu Kakkar.'),
(17, 'Enrique', '2022-06-15', 'test');

